Input: There are five stages of mitosis that must be carried out correctly for a cell to properly divide. Match the stage of mitosis with its proper component:
Prophase — Dissolution of nucleoli Choices: a) Metaphase — Formation of two distinct nuclear membranes b) Cytokinesis — Separation of sister chromatids to their respective poles c) Telophase — Formation of the equatorial plate d) Anaphase — Separation of the cytoplasm and organelles 
Output: {'sol': 'a'}

